import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { HelmetProvider } from 'react-helmet-async';
// routes
import Router from './routes';
// theme
import ThemeProvider from './theme';
// components
import ChatBubble from './layouts/chatbot/chatbot';
import { StyledChart } from './components/chart';
import ScrollToTop from './components/scroll-to-top';
import AuthProvider from './context/supaContex';
import {AuthRoute} from "./components/protectRoute/AuthRoute";
import LoginPage from './pages/LoginPage';
import DashboardLayout from './layouts/dashboard/DashboardLayout';
import UserPage from './pages/UserPage';
import DashboardAppPage from './pages/DashboardAppPage';

// ----------------------------------------------------------------------

export default function App() {
  const chatUrl = 'https://mediafiles.botpress.cloud/634d2b82-4a73-4676-85d7-764180e85b0f/webchat/bot.html';

  return (
    <HelmetProvider>
      <AuthProvider>
      <BrowserRouter>
        <ThemeProvider>
          <ScrollToTop />
          <StyledChart />
          <ChatBubble url={chatUrl} />
         <Router/>
        </ThemeProvider>
      </BrowserRouter>
      </AuthProvider>
     
    </HelmetProvider>
  );
}
